import React from 'react';
import './Experience.css';
import CVEntry from './CVEntry';

function Experience() {
  const experiences = [
    {
      title: 'Digital Content Executive',
      location: 'RKW Limited, Stoke, Stoke-on-trent',
      dates: 'July 2024 - Present',
      responsibilities: [
        'Upload product content using RKW’s PIM (Product Information Management system) whilst ensuring product content appears to best in class standard across a portfolio of branded websites. Ensure all written product content is created with SEO in mind.',
        'Collaborated witMaintain product video content on branded You Tube channels as well as blog and recipe content across the websites.h designers to create responsive designs.',
        'Create website landing pages to support campaigns, promotional periods and new product launches.',
      ],
    },
    {
      title: 'Web Designer',
      location: 'Company ABC, San Francisco, CA',
      dates: 'January 2018 - May 2020',
      responsibilities: [
        'Designed and implemented web layouts using HTML, CSS, and JavaScript.',
        'Ensured cross-browser compatibility.',
        'Worked with backend developers to integrate APIs.',
      ],
    },
  ];

  return (
    <div className='experience-container'>
      <h1>DANIEL DAVIES</h1>
      <h2>
        <mark style={{ backgroundColor: '#3498db' }}>Web Development</mark> |{' '}
        <mark style={{ backgroundColor: '#1abc9c' }}>Digital Content</mark>
      </h2>
      <div className='experience-email'>
        <i className='fa-solid fa-envelope' style={{ color: 'black' }}></i>
        <p>E-Mail: danieldavies2203@gmail.com</p>
      </div>
      <div className='experience-phone'>
        <i className='fa-solid fa-phone' style={{ color: 'black' }}></i>
        <p>Phone Number: 07383560716</p>
      </div>

      <h3>EXPERIENCE</h3>
      <hr></hr>
      {experiences.map((experience, index) => (
        <CVEntry
          key={index}
          title={experience.title}
          location={experience.location}
          dates={experience.dates}
          responsibilities={experience.responsibilities}
        />
      ))}
    </div>
  );
}

export default Experience;
